import React from 'react';

const CampusBus = () => {
  const busSchedule = {
    nilaToSahyadri: {
      route: "Nila → Sahyadri",
      times: ["9:00 PM", "10:00 PM", "11:00 PM", "12:00 AM"]
    },
    sahyadriToNila: {
      route: "Sahyadri → Nila", 
      times: ["9:15 PM", "10:15 PM", "11:15 PM", "7:30 AM"]
    }
  };

  return (
    <div className="campus-bus">
      <h2>Campus Bus</h2>

      {Object.entries(busSchedule).map(([key, schedule]) => (
        <div key={key} className="bus-route">
          <h3 className="route-title">{schedule.route}</h3>
          <div className="time-slots">
            {schedule.times.map((time, index) => (
              <button 
                key={index} 
                className={`time-slot ${index === 1 ? 'active' : ''}`}
              >
                {time}
              </button>
            ))}
          </div>
        </div>
      ))}

      <button className="show-schedule-btn">
        Show Bus Schedule
      </button>
    </div>
  );
};

export default CampusBus;
